  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Windom
  Wetland Management District summarizes District activities during the 1992 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Land acquisition is also covered.  The report includes a planning section
  which discusses the master plan, research, and investigations.  Administration is
  outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given.  Habitat management is also covered.  Subjects include
  wetlands, croplands, grasslands, fire management, pest control, Farmers Home Administration
  Easements, and private lands.  The wildlife section of the report discusses wildlife
  diversity, endangered species, threatened species, waterfowl, marsh birds, water
  birds, shorebirds, raptors, game mammals, scientific collections, and marking/banding.
  \ The public uses of the District described in this report include outdoor classrooms,
  hunting, fishing, trapping, and law enforcement.  The equipment and facilities section
  of the report provides information about rehabilitation, equipment utilization/replacement,
  communications systems, computer systems, and energy conservation.  Cooperative
  programs and items of interest are provided at the end; brochures are attached.\",\n\t\"owner_org\":
